(167, 'cms', '', '', '', 'cms', 'item', 'gov15_focus_flash', 'module_data', 'a:29:{s:8:"order_by";a:0:{}s:8:"pageable";s:1:"0";s:3:"ids";s:0:"";s:5:"limit";s:1:"4";s:8:"template";s:20:"common/slide/slide11";s:6:"method";s:5:"label";s:13:"unset_options";a:0:{}s:8:"category";a:0:{}s:7:"keyword";s:0:"";s:9:"attribute";s:1:"1";s:6:"sphinx";s:1:"0";s:5:"width";s:3:"300";s:6:"height";s:3:"216";s:4:"rows";s:1:"1";s:16:"top_title_length";s:2:"40";s:12:"title_length";s:2:"60";s:9:"title_dot";s:1:"0";s:14:"summary_length";s:3:"120";s:7:"tplcode";s:3044:"<!--{php168}-->\r\n<style type="text/css">\r\n#focPic_{$label[''id'']} {\r\n	width:{$swidth}px;\r\n	height:<!--{php echo $sheight+77;}-->px;\r\n	background:url(images/indFocPicBg.png) no-repeat;\r\n	overflow:hidden;\r\n}\r\n#focPic_{$label[''id'']} .bd {\r\n	width:{$swidth}px;\r\n	height:{$sheight}px;\r\n	overflow:hidden;\r\n}\r\n#focPic_{$label[''id'']} .bd ul li {\r\n	width:{$swidth}px;\r\n	height:{$sheight}px;\r\n	position:relative;\r\n	overflow:hidden;\r\n	z-index:1;\r\n}\r\n#focPic_{$label[''id'']} .bd ul li .con .title a {\r\n	position:absolute;\r\n	bottom:0px;\r\n	width:{$swidth}px;\r\n	height:30px;\r\n	line-height:30px;\r\n	display:block;\r\n	text-align:center;\r\n	color:#fff;\r\n	z-index:3;\r\n}\r\n#focPic_{$label[''id'']} .bd ul li .con .bg {\r\n	filter:alpha(opacity=40);\r\n	-moz-opacity:0.4;\r\n	-khtml-opacity: 0.4;\r\n	opacity: 0.4;\r\n	background:#000;\r\n	height:28px;\r\n	width:<!--{php echo $swidth+8;}-->px;\r\n	position:absolute;\r\n	left:0;\r\n	bottom:0;\r\n	z-index:2;\r\n}\r\n#focPic_{$label[''id'']} .hd {\r\n	padding-left:4px;\r\n	overflow:hidden;\r\n}\r\n#focPic_{$label[''id'']} .hd ul {\r\n	padding-left:1px;\r\n}\r\n#focPic_{$label[''id'']} .hd ul li {\r\n	float:left;\r\n	padding:4px 4px 0;\r\n	height:52px;\r\n	width:65px;\r\n	overflow:hidden;\r\n}\r\n#focPic_{$label[''id'']} .hd ul li img {\r\n	width:61px;\r\n	height:48px;\r\n	padding:1px;\r\n	border:1px solid #ccc;\r\n}\r\n#focPic_{$label[''id'']} .hd ul li.on {\r\n	background:url({$RESOURCE}/skin/label/dot04.png) center top no-repeat;\r\n}\r\n#focPic_{$label[''id'']} .hd ul li.on img {\r\n	border:1px solid #6395cb;\r\n}\r\n#focPic_{$label[''id'']} .hd ul .title {\r\n	display:none;\r\n}\r\n</style>\r\n<div class="focPic fl" id="focPic_{$label[''id'']}">\r\n  <div class="bd">\r\n    <ul>\r\n     <!--{foreach $list $key $value}-->\r\n      <li style="display: {if $key}none{/if};">\r\n        <div class="pic"><a target="_blank" href="{$value[''url'']}"><img src="{$value[''frame'']}" width="$swidth" height="$sheight" alt="{$value[''title'']}"></a></div>\r\n        <div class="con">\r\n          <div class="title"><a target="_blank" href="{$value[''url'']}">{$value[''title'']}</a></div>\r\n          <div class="bg"></div>\r\n        </div>\r\n      </li>\r\n      <!--{/foreach}--> \r\n    </ul>\r\n  </div>\r\n  <div class="hd">\r\n    <ul>\r\n     <!--{foreach $list $key $value}-->\r\n      <li class="{if !$key}on{/if}" title="{$value[''full_title'']}">\r\n        <div class="pic"><img src="{$value[''frame'']}"></div>\r\n        <div class="title"><a href="_blank">{$value[''title'']}</a></div>\r\n      </li>\r\n	<!--{/foreach}--> \r\n    </ul>\r\n  </div>\r\n</div>\r\n<script type="text/javascript">\r\n(function(){\r\nvar c = $(''#focPic_{$label[''id'']} .bd ul li'').length,a=0;timer =  setInterval(move_anti, 5000);\r\n$(''#focPic_{$label[''id'']} .hd ul li'').hover( function(){ clearInterval(timer);timer = null; a=$(''#focPic_{$label[''id'']} .hd ul li'').index($(this)); move_anti()},function(){ timer =  setInterval(move_anti, 5000);});\r\n\r\nfunction move_anti(){\r\n	$(''#focPic_{$label[''id'']} .bd ul li'').eq(a).fadeIn(500).siblings().hide();\r\n	$(''#focPic_{$label[''id'']} .hd ul li'').removeClass(''on'').eq(a).addClass(''on'');\r\n	a = a>=c-1?0:a+1;\r\n}\r\n})();\r\n</script>\r\n<!--{/php168}-->";s:7:"bgcolor";s:0:"";s:10:"var_fields";a:0:{}s:5:"model";s:0:"";s:4:"uids";s:0:"";s:9:"timestamp";a:3:{i:0;s:0:"";i: