(6165, 'cms', 'item', '', '', '', '', 'neiyetab_1_con5', 'html', 'a:4:{s:7:"bgcolor";s:0:"";s:13:"allowed_roles";a:0:{}s:18:"place_holder_width";s:2:"48";s:19:"place_holder_height";s:2:"23";}', '<p style="margin:10px 0;float:right;width:450px">\r\n	国微软件专注于政府、企业内网实际应用领域，提供具有自主知识产权的互联网软件产品和解决方案，致力满足企业细节信息化问题。其原PHP168品牌产品共覆盖超过千名商业用户，以及数量庞大的免费用户群体。<br />\r\n	我们拥有一群充满激情的年轻团队，公司80%为技术人员。他们来自国内知名IT企业，历经产品与项目磨练。国微PHP168 Sharp系列总架构师姚秋号、产品开发负责人王海滨先生均为该领域内杰出领头人<a href="{$core.controller}/cms/item-view-id-1042.shtml" target="_blank"><span style="color:#b22222;">[详细]</span></a></p>\r\n<p>\r\n	</p>', '$label[neiyetab_1_con5]', 0, 1440552702, 1582093157, 300, '');
