(606, 'core', 'page', '', '', '', '', 'ldzc_con1', 'html', 'a:4:{s:7:"bgcolor";s:0:"";s:13:"allowed_roles";a:0:{}s:18:"place_holder_width";s:2:"60";s:19:"place_holder_height";s:2:"20";}', '<ul>\r\n<li><a target="_blank" href="{$core.controller}/cms/item-view-id-1067.shtml">信息公开指南</a></li>\r\n<li><a target="_blank" href="{$core.controller}/cms/item-list-category-1241">信息公开制度</a></li>\r\n<li><a target="_blank" href="{$core.controller}/cms/item-list-category-707.shtml">信息公开目录</a></li>\r\n<li><a target="_blank" href="{$core.controller}/cms/item-list-category-773.shtml">政府领导班子</a></li>\r\n<li><a target="_blank" href="{$core.controller}/cms/item-list-category-1065.shtml">信息公开年报</a></li>\r\n<li><a target="_blank" href="{$core.controller}/forms-post?mid=37">依申请公开</a></li>\r\n</ul>', '$label[ldzc_con1]', 0, 1409278149, 1543564168, 300, 'page_51');
