(11003, 'core', 'letter', '', '', '', '', 'letter_tab1_con', 'html', 'a:4:{s:7:"bgcolor";s:0:"";s:13:"allowed_roles";a:0:{}s:18:"place_holder_width";s:2:"60";s:19:"place_holder_height";s:2:"20";}', '<p>战友们：欢迎访问新版“党委机关信箱”！开设这个信箱，主要是在党委机关与广大基层官兵之前搭起交流互动平台，进一步畅通民主渠道，倾听官兵心声，及时了解基层情况，集思广益改进工作，推进部队建设发展。</p>\r\n\r\n<p>来信即可反映个人的情况和心愿，也可以对部队建设提出建议意见；即可用单位名义，也可以用个人身份；既可以用真实姓名，也可以用虚假网名。希望战友们解放思想，畅所欲言，反映真实情况，积极建言献策。</p>', '$label[letter_tab1_con]', 0, 1572485831, 1581977497, 300, 'gb_cid_0');
