(6581, 'core', 'page', '', '', '', '', 'neiye_ysqgk_con', 'html', 'a:4:{s:7:"bgcolor";s:0:"";s:13:"allowed_roles";a:0:{}s:18:"place_holder_width";s:2:"60";s:19:"place_holder_height";s:2:"20";}', '<p>\r\n	<strong>一、办理流程</strong><br />\r\n	<br />\r\n	　　公民、法人和其他组织需要政府及相关部门主动公开以外的政府信息，可以向政府及相关部门提出申请，政府及相关部门按照《中华人民共和国政府信息公开条例》第二十一条的规定进行处理。<br />\r\n	<br />\r\n	（一）确定受理机构<br />\r\n	<br />\r\n	　　受理机构是政府及相关部门内部所设置的相应办事机构，是依申请公开政府信息的主体。受理机构的详细联系方式见政府及相关部门的政府信息公开指南。<br />\r\n	<br />\r\n	（二）提出申请<br />\r\n	<br />\r\n	　　1、获取和填写申请表<br />\r\n	<br />\r\n	　　向受理机构提出政府信息公开申请，须填写《政府信息公开申请表》（样本见附表，以下简称《申请表》）。《申请表》复制有效，可以在受理机构处领取，也可以在政府及相关部门网站上下载电子版。为了提高处理申请的效率，申请人对所需信息的描述请尽量详尽、明确；若有可能，请提供该信息的标题、发布时间、文号或者其他有助于政府及相关部门确定信息载体的提示。<br />\r\n	<br />\r\n	　　2、提交申请表<br />\r\n	<br />\r\n	　　申请人可以通过政府及相关部门网站、信函或当面递交填写完整的《申请表》。通过信函方式提出申请的，请在信封左下角注明 “ 政务信息公开申请 ” 字样；申请人也可以到受理机构处，当场提出申请。<br />\r\n	　　受理机构不直接受理通过电话提出的政务信息公开申请，但申请人可以通过电话咨询申请程序。<br />\r\n	<br />\r\n	（三）申请处理<br />\r\n	<br />\r\n	　　受理机构收到申请后，从形式上对申请的要件是否完备进行审查，对于要件不完备的申请予以退回，要求申请人补正。<br />\r\n	　　申请获取的信息如果属于行政机关已经主动公开的信息，受理机构中止受理申请程序，告知申请人获得信息的方式和途径。<br />\r\n	　　受理机构根据收到申请的先后次序来处理申请，单件申请中同时提出几项独立请求的，受理机构将全部处理完毕后统一答复。鉴于针对不同请求的答复可能不同，为提高处理效率，建议申请人就不同请求分别申请。<br />\r\n	　　</p>\r\n<p>\r\n	<strong>二、申请办理时限</strong><br />\r\n	<br />\r\n	　　受理机构按照工作流程受理依申请公开事项后，按照《中华人民共和国政府信息公开条例》第二十四条的规定，在15个工作日内进行答复。<br />\r\n	&nbsp;</p>\r\n<p>\r\n	<strong>三、申请办理收费</strong><br />\r\n	<br />\r\n	　　依申请提供政府信息的费用收取按照《中华人民共和国政府信息公开条例》第二十七条、第二十八条的规定执行。除收取检索、复制、邮寄等成本费用外，不收取其他费用。申请人确有经济困难的，凭有关证明，经批准后，可减免相关费用。 &nbsp;<br />\r\n	<br />\r\n	<br />\r\n	<br />\r\n	<br />\r\n	<br />\r\n	<br />\r\n	<br />\r\n	<br />\r\n	<br />\r\n	&nbsp;</p>&nbsp;', '$label[neiye_ysqgk_con]', 0, 1440607324, 1543564168, 300, 'page_51');
