REPLACE INTO `p8_label` (`id`, `system`, `module`, `site`, `env`, `source_system`, `source_module`, `name`, `type`, `option`, `content`, `invoke`, `variable`, `timestamp`, `last_update`, `ttl`, `postfix`) VALUES
(5840, 'core', 'opinion', '', '', '', '', 'wlwz_suqiu_link', 'html', 'a:4:{s:7:"bgcolor";s:0:"";s:13:"allowed_roles";a:0:{}s:18:"place_holder_width";s:2:"60";s:19:"place_holder_height";s:2:"20";}', '<a onclick="show(''fd1'');return false;" href="#"><em class="a5">电话</em></a> <a onclick="show(''fd2'');return false;" href="#"><em class="a3">短信</em></a> <a onclick="show(''fd3'');return false;" href="#"><em class="a1">传真</em></a> <a onclick="show(''fd4'');return false;" href="#"><em class="a2">邮件</em></a> <a onclick="show(''fd5'');return false;" href="#"><em class="a4">QQ</em></a>\r\n\r\n<div style="display:none;" class="fd" id="fd1">\r\n							<div class="fdbg"></div>\r\n							<a class="close" onclick="closeed(''fd1'');return false;" href="#"></a>\r\n							<div class="condiv">\r\n								<div class="tit">电话提交方式</div>\r\n								<div class="con2">拨打电话12345-1-1，将诉求告知工作人员即可。</div>\r\n							</div>\r\n						</div>\r\n<div style="display:none;" class="fd" id="fd2">\r\n							<div class="fdbg"></div>\r\n							<a class="close" onclick="closeed(''fd2'');return false;" href="#"></a>\r\n							<div class="condiv">\r\n								<div class="tit">短信提交方式</div>\r\n								<div class="con2"> <strong>提交诉求：</strong><br>\r\n									1、移动用户编辑“诉求内容”发送到1065730123456<br>\r\n									2、联通/小灵通用户编辑“诉求内容”发送到13405912345<br>\r\n									<strong>查询诉求：</strong><br>\r\n									1、移动用户发送“11位或13位诉求件编号”至：1065730123456；<br>\r\n									2、联通、小灵通用户发送“11位或13位诉求件编号”至：13405912345<br>\r\n									3、短信收费标准（以运营商收费标准为准）：移动用户每条0.1元、联通用户每条0.1元、小灵通用户每条0.08元，福州12345不另加收费；\r\n									<p> <strong>短信发送注意事项：</strong><br>\r\n										1、用户向12345平台发送短信反映问题时，一定要写明以下两个要点：<br>\r\n										&#160;&#160;&#160;&#160;1）呼叫内容（精炼扼要）<br>\r\n										&#160;&#160;&#160;&#160;2）事件地点（详细标明）<br>\r\n										&#160;&#160;&#160;&#160;3）短信无法查询内部诉求件办理结果<br>\r\n										2、建议用户短信字数控制在150个字之内。 </p>\r\n								</div>\r\n							</div>\r\n						</div>\r\n<div style="display:none;" class="fd" id="fd3">\r\n							<div class="fdbg"></div>\r\n							<a class="close" onclick="closeed(''fd3'');return false;" href="#"></a>\r\n							<div class="condiv">\r\n								<div class="tit">传真提交方式</div>\r\n								<div class="con2">将诉求内容形成书面意见传真到12345-1-4即可。</div>\r\n							</div>\r\n						</div>\r\n<div style="display:none;" class="fd" id="fd4">\r\n							<div class="fdbg"></div>\r\n							<a class="close" onclick="closeed(''fd4'');return false;" href="#"></a>\r\n							<div class="condiv">\r\n								<div class="tit">邮件提交方式</div>\r\n								<div class="con2">将诉求内容发送电子邮件到信箱12345@fz12345.gov.cn即可。</div>\r\n							</div>\r\n						</div>\r\n<div style="display:none;" class="fd" id="fd5">\r\n							<div class="fdbg"></div>\r\n							<a class="close" onclick="closeed(''fd5'');return false;" href="#"></a>\r\n							<div class="condiv">\r\n								<div class="tit">QQ提交方式</div>\r\n								<div class="con2">通过QQ添加好友（QQ号：800002181），将诉求告知工作人员。<br>\r\n									<strong>QQ诉求注意事项：</strong><br>\r\n									QQ人工受理时间为7：00-22：00，其他非人工受理时间，请通过其他方式诉求。</div>\r\n							</div>\r\n						</div>\r\n', '$label[wlwz_suqiu_link]', 0, 1440519044, 1577670671, 300, 'opinion');
