(5923, 'core', 'opinion', '', '', '', '', 'wlwz_rtbox6_con', 'html', 'a:4:{s:7:"bgcolor";s:0:"";s:13:"allowed_roles";a:0:{}s:18:"place_holder_width";s:2:"60";s:19:"place_holder_height";s:2:"20";}', '　　欢迎您通过网络问政平台，对政府所属各级部门（单位）在办事效率、服务态度、依法行政、廉政建设等方面存在的问题进行咨询、投诉或提出建议，我们希望通过您的积极参与，来提升政府部门的办事效率和服务水平。\r\n\r\n　　为确保您所反映的问题能得到及时处理，请在咨询、投诉或建议之前，仔细阅读以下须知事项：\r\n　　一、办理流程\r\n　　您在网站上所反映的问题，工作人员会在工作时间内（周一至周五，8：30至12：00，14：00至18：00）根据问题的内容转有关部门进行调查处理，并尽快将处理的结果在本网站网络问政平台向社会公开。\r\n　　二、受理范围\r\n　　1、对原州区国民经济和社会发展提出的建议、意见。\r\n　　2、对政府及其工作部门和相关工作人员的办事效率、工作作风等方面的批评、意见和建议。\r\n　　3、依法可以由政府及其工作部门负责处理的投诉请求。\r\n　　4、对政府机关有关的政策法规进行咨询。\r\n　　', '$label[wlwz_rtbox6_con]', 0, 1440519092, 1577670671, 300, 'opinion');
