(6409, 'core', 'opinion', '', '', '', '', 'dep_10', 'html', 'a:4:{s:7:"bgcolor";s:0:"";s:13:"allowed_roles";a:0:{}s:18:"place_holder_width";s:2:"60";s:19:"place_holder_height";s:2:"20";}', '彻落实区委区政府人才活力工程，关心和培养一批工作能力较好、作风扎实、有大局意识和创新意识的年轻干部，杨桥镇积极实施村级干部交流和机关干部多岗位历练。杨桥镇党委政府经过统一部署，以座谈会、评议、个别谈话等方式全面考察村（社区）干部和村级后备干部，准确掌握各村（社区）干部队伍情况和村情民意，为下一步村（社区）干部交流调整打下坚实基础。与此同时，通过考查对7名机关干部岗位进行了轮岗调', '$label[dep_10]', 0, 1440565777, 1545915984, 300, 'wzxz_1');
