(6412, 'core', 'opinion', '', '', '', '', 'dep_10', 'html', 'a:4:{s:7:"bgcolor";s:0:"";s:13:"allowed_roles";a:0:{}s:18:"place_holder_width";s:2:"60";s:19:"place_holder_height";s:2:"20";}', '发展和改革局是县人民政府的工作部门，是研究和提出全县国民经济和社会发展战略、总量平衡、结构调整的综合经济管理部门。主要负责全县经济和发展规划、监测、预测经济运行、管理全社会固定资产投资、开展经济技术协作、组织和实施经济社会发展项目、指导全县推进各项改革等职能。贯彻执行价格法律、法规、规章和价格方针；负责全县价格工作的宏观管理和综合平衡；会同有关部门管理县级行政事业性收费项目；', '$label[dep_10]', 0, 1440565777, 1544315678, 300, 'wzxz_13');
REPLACE INTO `p8_label` (`id`, `system`, `module`, `site`, `env`, `source_system`, `source_module`, `name`, `type`, `option`, `content`, `invoke`, `variable`, `timestamp`, `last_update`, `ttl`, `postfix`) VALUES
(6413, 'core', 'opinion', '', '', '', '', 'dep_10', 'html', 'a:4:{s:7:"bgcolor";s:0:"";s:13:"allowed_roles";a:0:{}s:18:"place_holder_width";s:2:"60";s:19:"place_holder_height";s:2:"20";}', '1、拟订和执行全县财政发展战略、中长期规划及改革方案。参与制定有关综合经济政策，提出运用财税政策实施县级调控和综合平衡社会财力的建议。拟订和执行县与乡（镇）的分配政策。 2、拟订财政、财务、会计管理的规范性文件草案；制定全县财政、财务、会计管理规章制度并监督、执行。 3、承担县级各项财政收支管理的职能。负责编制年度县级预算草案并组织执行；向县人民代表大会报告县级预算及其执行情况。', '$label[dep_10]', 0, 1440565777, 1544444067, 300, 'wzxz_3');
