(10064, 'cms', 'item', '', '', 'core', 'letter', 'service_con2', 'module_data', 'a:21:{s:8:"order_by";a:0:{}s:8:"pageable";s:1:"0";s:3:"ids";s:0:"";s:5:"limit";s:2:"10";s:8:"template";s:18:"letter/list_scroll";s:6:"method";s:5:"label";s:13:"unset_options";a:0:{}s:12:"statistic_id";s:1:"0";s:6:"status";s:0:"";s:6:"sphinx";s:1:"0";s:12:"title_length";s:2:"20";s:9:"title_dot";s:1:"0";s:14:"summary_length";s:3:"120";s:7:"tplcode";s:1921:"<!--{php168}-->\r\n<style>\r\n.label_table_scroll th {background: #ebf3fa;color: #6e4b2d;font: normal 14px/30px ''microsoft yahei'';}\r\n.label_table_scroll td{color: #555;font:normal 14px/30px ''microsoft yahei'';}\r\n.pl10{padding-left: 10px;}\r\n.mt5{margin-top:5px;}\r\n.tc{text-align: center;}\r\n</style>\r\n<table width="100%" border="0" cellspacing="0" cellpadding="0" class="label_table_scroll" style="margin-bottom:0;">\r\n	<tr>\r\n		<th width="100" class="pl10">申请人</th>\r\n		<th width="auto">事项名称</th>\r\n		<th width="100">受理日期</th>\r\n		<th width="80">办理状态</th>\r\n	</tr>\r\n</table>\r\n<div class="mt5"></div>	\r\n<div id="scroll_{$label[''id'']}" style="height:180px;line-height:30px;overflow:hidden">\r\n	<table width="100%" border="0" cellspacing="0" cellpadding="0" class="label_table_scroll" style="margin-bottom:0;">\r\n	 <!--{foreach $list $key $row}-->\r\n	<tr id="item_$value[id]">\r\n		  <td class="pl10" width="100"><a href="$row[url]" title="$row[full_title]" target="_blank">$row[type_name]</a></td>\r\n		  <td>$row[title]</td>\r\n		  <td width="100" class="tc"><!--{php echo date(''Y-m-d'',$row[''create_time'']);}--></td>\r\n		  <td width="80" class="tc">{if $row[status]==3}{else}{/if}$row[status_name]</td>\r\n	</tr>\r\n	<!--{/foreach}-->\r\n	</table>\r\n</div>\r\n<script type="text/javascript">\r\n(function(){\r\nvar this_Scroll = document.getElementById("scroll_{$label[''id'']}");\r\nthis_Scroll.innerHTML+=this_Scroll.innerHTML;\r\nvar ScrollTimer=0;\r\nvar MyMar = setInterval(Scroll,2500);\r\nthis_Scroll.onmouseover=functi