(10448, 'cms', '', '', '', 'cms', 'item', 'gov_bd_zt_con1', 'module_data', 'a:29:{s:8:"order_by";a:0:{}s:8:"pageable";s:1:"0";s:3:"ids";s:0:"";s:5:"limit";s:2:"10";s:8:"template";s:31:"common/scroll/pic_title_scroll3";s:6:"method";s:5:"label";s:13:"unset_options";a:0:{}s:8:"category";a:0:{}s:7:"keyword";s:0:"";s:9:"attribute";s:1:"6";s:6:"sphinx";s:1:"0";s:5:"width";s:3:"300";s:6:"height";s:3:"400";s:4:"rows";s:1:"1";s:16:"top_title_length";s:2:"40";s:12:"title_length";s:2:"60";s:9:"title_dot";s:1:"0";s:14:"summary_length";s:3:"120";s:7:"tplcode";s:2854:"<!--{php168}-->\r\n<style type="text/css">\r\n#js_allBtm_{$label[''id'']}{width:980px;position:relative;height:60px;padding:0 25px;}\r\n#js_allBtm_{$label[''id'']} .mainCont{ width:980px;overflow:hidden;position: relative;}\r\n#js_allBtm_{$label[''id'']} .mainCont ul{overflow:hidden}\r\n#js_allBtm_{$label[''id'']} li{width:180px;overflow:hidden;height:60px;margin:0 8px;float:left;display:inline;}\r\n#js_allBtm_{$label[''id'']} .leftBtn, #js_allBtm_{$label[''id'']} .rightBtn{position: absolute;z-index: 1;top: 12px;width:16px;height:33px;float: left;}\r\n#js_allBtm_{$label[''id'']} .leftBtn{left:0;}\r\n#js_allBtm_{$label[''id'']} .rightBtn{right:0;}\r\n#js_allBtm_{$label[''id'']} a{ background:url({$RESOURCE}/skin/label/label_btn.png) no-repeat; width:16px;height:33px;display:block;}\r\n#js_allBtm_{$label[''id'']} .leftBtn a{background-position:0 0;}\r\n#js_allBtm_{$label[''id'']} .rightBtn a{background-position:0 -33px;}\r\n</style>\r\n<div class="homebtm layout" id="js_allBtm_{$label[''id'']}">\r\n    <div class="leftBtn" id="js_prevImg"><a href="javascript:void(0);"></a></div>\r\n    <div class="rightBtn" id="js_nextImg"><a href="javascript:void(0);"></a></div>\r\n	<div class="mainCont" id="js_scrollBox">        \r\n        <ul>\r\n			<!--{foreach $list $value}-->\r\n			<li>\r\n				<a href="$value[url]" target="_blank" title="$value[full_title]"><img width="180" height="60" alt="$value[full_title]" src="{if empty($value[''frame''])}{$RESOURCE}/images/nopic.jpg{else}$value[frame]{/if}" /></a>\r\n			</li>\r\n			<!--{/foreach}-->\r\n		</ul>\r\n    </div>\r\n</div>\r\n<script type="text/javascript">\r\n    $(function(){\r\n		var speed=2500;\r\n		var liWidth=196;\r\n		var move=196;\r\n		var obj=$("#js_scrollBox ul");\r\n		var allLi=obj.html();\r\n		var liLen=$("#js_scrollBox ul li").length;\r\n		var yd=liWidth*liLen;\r\n		obj.width(liWidth*liLen*3+"px");\r\n		obj.append(allLi);\r\n		obj.prepend(allLi);\r\n		obj.css({"margin-left":-yd+"px"});\r\n\r\n		function oneMove(style){\r\n			if(style=="left"){\r\n				var moveWidth=move;\r\n				}else{\r\n					var moveWidth=-move;\r\n					}\r\n			var leftPos=obj.css("margin-left").replace(''px'', '''');\r\n			leftPos=parseInt(leftPos);\r\n			obj.stop(true,false).animate(\r\n			{marginLeft:leftPos+moveWidth},\r\n			500,\r\n			function(){\r\n				var now=parseInt(obj.css("margin-left").replace(''px'', ''''));\r\n				if(now>=0){\r\n				obj.css("marginLeft",-yd+"px");\r\n				}\r\n				if(now<=-2*yd){\r\n				obj.css("marginLeft",-yd+"px");\r\n				}\r\n		}\r\n			)\r\n			\r\n			}\r\n		$("#js_nextImg").click(function(){\r\n			if(!obj.is(":animated")){oneMove();}\r\n			\r\n			});\r\n		$("#js_prevImg").click(function(){\r\n			if(!obj.is(":animated")){oneMove("left");}\r\n			});\r\n\r\n\r\n		var liTimer=setInterval(oneMove,speed);\r\n		$("#js_allBtm_{$label[''id'']}").mouseenter(function(){\r\n			clearInterval(liTimer);\r\n			});\r\n		$("#js_allBtm_{$label[''id'']}").mouseleave(function(){\r\n		liTimer=setInterval(oneMove,speed);\r\n			});\r\n});\r\n</script>\r\n<!--{/php168}-->";s:7:"bgcolor";s:0:"";s:10:"var_fields";a:0:{}s:5:"model";s:0:"";s:4:"uids";s:0:"";s:9:"timestamp";a:3:{i:0;s:0:"";i:1;s:0:"";s:7:"exclude";s:0:"";}s:6:"field#";a:0:{}s:15:"order_by_string";s:16:"a.timestamp DESC";s:13:"allowed_roles";a:0:{}s:18:"place_holder_width";s:3:"100";s:19:"place_holder_height";s:2:"30";}', '', '$label[gov_bd_zt_con1]', 0, 1491640065, 1582169797, 300, 'index');
