(10958, 'core', 'page', '', '', '', '', 'count', 'sql', 'a:6:{s:8:"template";s:18:"cms/statistic/list";s:7:"tplcode";s:431:"<!--{php168}-->\r\n<table width="100%" border="0" cellspacing="0" cellpadding="0" class="countlist">\r\n	<tr>\r\n		<th width="40%">栏目名</th>\r\n		<th wdith="30%">排名</th>\r\n		<th width="30%">数量</th>\r\n	</tr>\r\n	<!--{foreach $list $key $value}-->\r\n	<!--{php $k=$key%2;$key++;}-->\r\n	<tr class="trc_{$k}">\r\n		<td>$value[title]</td>\r\n		<td>{$key}</td>\r\n		<td>$value[post]</td>\r\n	</tr>\r\n	<!--{/foreach}-->\r\n</table>\r\n<!--{/php168}-->\r\n";s:7:"bgcolor";s:0:"";s:13:"allowed_roles";a:0:{}s:18:"place_holder_width";s:3:"100";s:19:"place_holder_height";s:2:"30";}', 'select id,name as title,(\r\nselect count(*) from `p8_cms_item` where p8_cms_item.`cid` = p8_cms_category.`id`\r\nAND DATE_SUB(CURDATE(), INTERVAL 30 DAY) <= date(p8_cms_item.create_time)\r\n) AS post\r\nFROM `p8_cms_category`\r\nwhere parent = 1\r\nORDER BY post desc\r\nLIMIT 0 , 100', '$label[count]', 0, 1571318084, 1582130705, 300, 'page_56');
