(10959, 'core', 'page', '', '', '', '', 'count2', 'sql', 'a:6:{s:8:"template";s:18:"cms/statistic/list";s:7:"tplcode";s:465:"<!--{php168}-->\r\n<table width="100%" border="0" cellspacing="0" cellpadding="0" class="countlist">\r\n	<tr>\r\n		<th width="40%">栏目名</th>\r\n		<th wdith="30%">排名</th>\r\n		<th width="30%">数量</th>\r\n	</tr>\r\n	<!--{foreach $list $key $value}-->\r\n	<!--{php $k=$key%2;$keys=$key+1;}-->\r\n	<tr class="trc_{$k}">\r\n		<td>$value[title]</td>\r\n		<td>$keys</td>\r\n		<td>{if $value[post]}$value[post]{else}0{/if}</td>\r\n	</tr>\r\n	<!--{/foreach}-->\r\n</table>\r\n<!--{/php168}-->\r\n";s:7:"bgcolor";s:0:"";s:13:"allowed_roles";a:0:{}s:18:"place_holder_width";s:2:"60";s:19:"place_holder_height";s:2:"20";}', 'select id,name as title,(\r\nselect count(*) from `p8_cms_item` where p8_cms_item.`cid` = p8_cms_category.`id`\r\nAND p8_cms_item.`create_time` >= UNIX_TIMESTAMP(DATE_FORMAT(CURDATE(),''%Y-01-01 00:00:00''))\r\n) AS post\r\nFROM `p8_cms_category`\r\nwhere parent = 1\r\nORDER BY post desc\r\nLIMIT 0 , 100', '$label[count2]', 0, 1571318384, 1582130705, 300, 'page_56');
